import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Layout from '../components/Layout/Layout';

function App() {
  return (
    <Layout>
      <strong>This content is going to be rendered as the props.children inside the Layout component.</strong>
    </Layout>
  );
}

export default App;
